import React, { useState } from "react";
import {
  Box,
  Typography,
  TextField,
  Button,
  MenuItem,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Grid,
  Avatar,
} from "@mui/material";
import "../styles/styles.css";

function FileUpload() {
  const [selectedAudioFile, setSelectedAudioFile] = useState(null);
  const [selectedMidiFile, setSelectedMidiFile] = useState(null);
  const [selectedFormat, setSelectedFormat] = useState("");
  const [openArtistSelection, setOpenArtistSelection] = useState(false);
  const [artistCounts, setArtistCounts] = useState({
    "Amr Diab": 0,
    "Om Kalthoum": 0,
    "Sayed Darwish": 0,
    Abdelhalim: 0,
    Abdelwahab: 0,
    "Mickael Jackson": 0,
  });

  // Define image URLs for each artist
  const [artistImages] = useState({
    "Amr Diab": "/public/assets/amrdiab.jpeg",
    "Om Kalthoum": "public/assets/omkalthoum.jpeg",
    "Sayed Darwish": "public/assets/sayeddarwish.jpeg",
    Abdelhalim: "public/assets/abdelhalim.jpeg",
    Abdelwahab: "public/assets/abdelwahab.jpeg",
    "Mickael Jackson": "public/assets/jackson.jpeg",
  });

  const handleAudioFileChange = (event) => {
    setSelectedAudioFile(event.target.files[0]);
  };

  const handleMidiFileChange = (event) => {
    setSelectedMidiFile(event.target.files[0]);
  };

  const handleFormatChange = (event) => {
    setSelectedFormat(event.target.value);
  };

  const handleUpload = () => {
    // Handle file upload logic
    console.log("Audio file uploaded:", selectedAudioFile);
    console.log("MIDI file uploaded:", selectedMidiFile);
    console.log("Selected format:", selectedFormat);
  };

  const handleOpenArtistSelection = () => {
    setOpenArtistSelection(true);
  };

  const handleCloseArtistSelection = () => {
    setOpenArtistSelection(false);
  };

  const handleSelectArtist = (artist) => {
    const updatedCounts = { ...artistCounts };
    updatedCounts[artist]++;
    setArtistCounts(updatedCounts);
    setOpenArtistSelection(false);
  };

  return (
    <Box
      sx={{
        height: "100vh",
        maxWidth: 400,
        margin: "auto",
        marginTop: 10,
        padding: 2,
        "& > *": {
          marginBottom: 2,
        },
      }}
    >
      <Typography variant="h4" align="center" gutterBottom color="black">
        File Upload
      </Typography>
      <Button
        variant="contained"
        color="primary"
        fullWidth
        onClick={handleOpenArtistSelection}
        sx={{ marginBottom: 2 }} // Equal distance below the button
      >
        Select Your Favorite Artist
      </Button>
      <input
        type="file"
        accept="audio/*"
        onChange={handleAudioFileChange}
        style={{ display: "none" }}
        id="audio-file-input"
      />
      <input
        type="file"
        accept=".mid,.midi"
        onChange={handleMidiFileChange}
        style={{ display: "none" }}
        id="midi-file-input"
      />
      <Box sx={{ marginBottom: 2 }}>
        {" "}
        {/* Equal distance below the box */}
        <label htmlFor="audio-file-input">
          <Button variant="contained" component="span" fullWidth>
            {selectedAudioFile ? "Audio File Selected" : "Select Audio File"}
          </Button>
        </label>
      </Box>
      <Box sx={{ marginBottom: 2 }}>
        {" "}
        {/* Equal distance below the box */}
        <label htmlFor="midi-file-input">
          <Button variant="contained" component="span" fullWidth>
            {selectedMidiFile ? "MIDI File Selected" : "Select MIDI File"}
          </Button>
        </label>
      </Box>
      <TextField
        select
        fullWidth
        label="Select Format"
        value={selectedFormat}
        onChange={handleFormatChange}
        margin="normal"
        // color="white"
        sx={{ marginBottom: 2 }} // Equal distance below the dropdown
      >
        <MenuItem value="format1">WAV</MenuItem>
        <MenuItem value="format2">UpScaling</MenuItem>
        <MenuItem value="format3">SVS</MenuItem>
      </TextField>
      <Button
        variant="contained"
        color="primary"
        fullWidth
        onClick={handleUpload}
        disabled={!selectedAudioFile || !selectedMidiFile || !selectedFormat}
        sx={{ marginBottom: 2 }} // Equal distance below the button
      >
        Upload
      </Button>

      {/* Artist Selection Dialog */}
      <Dialog open={openArtistSelection} onClose={handleCloseArtistSelection}>
        <DialogTitle>Select Your Favorite Artist</DialogTitle>
        <DialogContent>
          <Grid container spacing={2}>
            {Object.keys(artistCounts).map((artist, index) => (
              <Grid item xs={4} key={index}>
                <Avatar
                  alt={artist}
                  src={artistImages[artist]} // Use dynamic image URLs
                  sx={{ width: 150, height: 150, margin: "auto" }} // Increased image size
                />
                <Typography
                  variant="subtitle1"
                  align="center"
                  sx={{ marginTop: 1 }}
                >
                  {" "}
                  {/* Added margin top */}
                  {artist}
                </Typography>
                <Typography
                  variant="subtitle2"
                  align="center"
                >{`Selected: ${artistCounts[artist]} times`}</Typography>
                <Box sx={{ textAlign: "center", marginTop: 1 }}>
                  <Button
                    variant="contained"
                    size="small" // Decreased button size
                    onClick={() => handleSelectArtist(artist)}
                  >
                    Select
                  </Button>
                </Box>
              </Grid>
            ))}
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseArtistSelection} color="primary">
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default FileUpload;
